INSERT INTO `Movie` VALUES (18,'ngoc@gmail.com',NULL,NULL,'2023-11-28 16:03:16.426127','ENABLE','Gran Turismo','PREMIERING','2023','110','Việt Nam',4.00,'Câu chuyện hoàn thành ước mơ cuối cùng của một người chơi Gran Turismo tuổi teen có kỹ năng chơi game đã giúp anh giành được một loạt cuộc thi Nissan để trở thành một tay đua xe chuyên nghiệp thực sự.','2023-10-19 08:22:55.953000','2023-08-09 08:22:55.953000','Từ game thủ thành tay đua','2023-12-30 00:00:00.000000','2023-12-30 00:00:00.000000'),(20,'ngoc@gmail.com',NULL,NULL,'2023-11-28 20:52:31.909050','ENABLE','Blue Beetle','PREMIERING','2023','110','Việt Nam',4.00,'Jaime Reyes, sinh viên tốt nghiệp đại học gần đây trở về nhà với đầy khát vọng cho tương lai của mình, chỉ để nhận ra rằng ngôi nhà đó không hoàn toàn như lúc anh rời bỏ nó. Khi anh tìm kiếm mục đích của mình trên thế giới, số phận đã can thiệp khi Jaime bất ngờ thấy mình sở hữu một di tích cổ xưa của công nghệ sinh học ngoài hành tinh: Scarab.','2023-10-19 08:22:55.953000','2023-08-16 08:22:55.953000','Jaime Reyes là một siêu anh hùng dù anh ấy có thích hay không.','2023-12-29 00:00:00.000000','2023-12-30 00:00:00.000000'),(21,'ngoc@gmail.com',NULL,NULL,'2023-11-28 20:58:25.853574','ENABLE','Saw X','PREMIERING','2023','110','Việt Nam',7.40,'JGiữa các sự kiện của \'Saw\' và \'Saw II\', John Kramer ốm yếu và tuyệt vọng tới Mexico để thực hiện một thủ tục y tế mang tính thử nghiệm và đầy rủi ro với hy vọng có được phương pháp chữa trị thần kỳ cho căn bệnh ung thư của mình, chỉ để phát hiện ra toàn bộ hoạt động này là một trò lừa đảo để lừa gạt. dễ bị tổn thương nhất. Được trang bị với một mục đích mới, kẻ giết người hàng loạt khét tiếng quay trở lại công việc của mình, lật ngược tình thế với những kẻ lừa đảo theo cách nội tạng đặc trưng của hắn thông qua những cái bẫy quỷ quyệt, loạn trí và khéo léo.','2023-10-19 08:22:55.953000','2023-08-16 08:22:55.953000','Chứng kiến ​​sự trở lại của Jigsaw.','2023-12-29 00:00:00.000000','2023-12-30 00:00:00.000000'),(22,'ngoc@gmail.com',NULL,NULL,'2023-11-28 21:05:22.308573','ENABLE','The Super Mario Bros. Movie','PREMIERING','2023','110','Việt Nam',7.70,'Trong khi làm việc dưới lòng đất để sửa đường ống dẫn nước chính, thợ sửa ống nước ở Brooklyn—và anh em—Mario và Luigi được đưa xuống một đường ống bí ẩn và lang thang vào một thế giới mới huyền diệu. Nhưng khi hai anh em bị chia cắt, Mario bắt tay vào một nhiệm vụ hoành tráng để tìm Luigi.','2023-10-19 08:22:55.953000','2023-08-16 08:22:55.953000','Không phải tất cả các anh hùng mặc áo choàng. Một số mặc quần yếm.','2023-12-29 00:00:00.000000','2023-12-30 00:00:00.000000'),(23,'ngoc@gmail.com',NULL,NULL,'2023-11-28 21:09:56.025828','ENABLE','Expend4bles','PREMIERING','2023','110','Việt Nam',6.40,'Được trang bị mọi loại vũ khí mà họ có thể sử dụng và các kỹ năng sử dụng chúng, Biệt đội đánh thuê là tuyến phòng thủ cuối cùng của thế giới và là đội được gọi khi tất cả các lựa chọn khác không còn nữa. Nhưng những thành viên mới trong đội với phong cách và chiến thuật mới sẽ mang đến cho “máu mới” một ý nghĩa hoàn toàn mới.','2023-10-19 08:22:55.953000','2023-09-15 08:22:55.953000','Họ sẽ chết khi họ chết.','2023-12-29 00:00:00.000000','2023-12-30 00:00:00.000000'),(24,'ngoc@gmail.com',NULL,NULL,'2023-11-28 21:14:07.137335','ENABLE','Parasite','PREMIERING','2023','110','Việt Nam',8.50,'Tất cả đều thất nghiệp, gia đình Ki-taek đặc biệt quan tâm đến Công viên giàu có và quyến rũ để kiếm kế sinh nhai cho đến khi họ vướng vào một sự cố bất ngờ.','2023-10-19 08:22:55.953000','2023-09-15 08:22:55.953000','Hãy hành động như thể bạn sở hữu nơi này.','2023-12-29 00:00:00.000000','2023-12-30 00:00:00.000000'),(25,'ngoc@gmail.com','ngoc@gmail.com','2023-12-14 09:59:41.622589','2023-11-28 22:08:13.727556','DELETED','Napoleon','PREMIERING','2023','110','Việt Nam',6.50,'Một thiên anh hùng ca kể về sự trỗi dậy và sụp đổ đầy trắc trở của Hoàng đế Pháp Napoléon Bonaparte và hành trình không ngừng nghỉ của ông để giành quyền lực qua lăng kính của mối quan hệ gây nghiện, đầy biến động với vợ mình, Josephine.','2023-12-22 08:22:55.953000','2023-12-22 08:22:55.953000','Anh ấy đến từ con số không. Anh ấy đã chinh phục được mọi thứ.','2023-12-23 00:00:00.000000','2023-12-29 00:00:00.000000'),(26,'ngoc@gmail.com','ngoc@gmail.com','2023-12-14 09:57:46.227101','2023-11-28 22:13:07.249289','DELETED','The Hunger Games: The Ballad of Songbirds & Snakes','PREMIERING','2023','110','Việt Nam',6.50,'64 năm trước khi trở thành tổng thống độc tài của Panem, Coriolanus Snow nhìn thấy cơ hội thay đổi vận mệnh khi cố vấn cho Lucy Grey Baird, nữ cống phẩm của Quận 12.','2023-12-22 08:22:55.953000','2023-12-22 08:22:55.953000','Mọi người đều khao khát một cái gì đó.','2023-12-23 00:00:00.000000','2023-12-29 00:00:00.000000'),(27,'ngoc@gmail.com','ngoc@gmail.com','2023-12-13 10:55:44.617051','2023-11-28 22:17:17.541623','DELETED','Trolls Band Together','PREMIERING','2023','110','Việt Nam',7.20,'Khi anh trai của Branch, Floyd, bị bắt cóc vì tài năng âm nhạc của mình bởi một cặp ngôi sao nhạc phản diện độc ác, Branch và Poppy bắt tay vào một cuộc hành trình đầy đau khổ và đầy cảm xúc để đoàn tụ những người anh em khác và giải cứu Floyd khỏi một số phận thậm chí còn tồi tệ hơn cả sự mù mờ của văn hóa đại chúng. .','2023-12-22 08:22:55.953000','2023-12-22 08:22:55.953000','Có một số trò troll mới trong khối.','2023-12-23 00:00:00.000000','2023-12-29 00:00:00.000000'),(28,'ngoc@gmail.com','ngoc@gmail.com','2023-12-13 10:55:22.221725','2023-11-28 22:21:34.438857','DELETED','Retribution','PREMIERING','2023','110','Việt Nam',7.00,'Khi một người gọi bí ẩn đặt một quả bom dưới ghế ô tô của anh, Matt Turner bắt đầu một cuộc rượt đuổi tốc độ cao xuyên thành phố để hoàn thành một loạt nhiệm vụ cụ thể - tất cả đều có những đứa con của anh bị mắc kẹt ở ghế sau.','2023-12-22 08:22:55.953000','2023-12-22 08:22:55.953000','Mọi con đường đều dẫn đến sự thật.','2023-12-29 00:00:00.000000','2023-12-29 00:00:00.000000'),(29,'ngoc@gmail.com','ngoc@gmail.com','2023-12-13 09:07:21.692144','2023-11-28 22:25:14.237428','DELETED','The Exorcist: Believer','PREMIERING','2023','110','Việt Nam',6.20,'Khi hai cô gái biến mất trong rừng và ba ngày sau quay trở lại mà không nhớ gì về những gì đã xảy ra với họ, cha của một cô gái đã tìm kiếm Chris MacNeil, người đã bị thay đổi mãi mãi bởi những gì xảy ra với con gái mình 50 năm trước.','2023-12-22 08:22:55.953000','2023-12-22 08:22:55.953000','Bạn có tin?','2023-12-21 00:00:00.000000','2023-12-29 00:00:00.000000'),(30,'ngoc@gmail.com','ngoc@gmail.com','2023-12-11 16:52:38.976448','2023-11-28 22:30:07.671261','DELETED','Thanksgiving','PREMIERING','2023','110','Việt Nam',6.20,'Sau khi cuộc bạo loạn Thứ Sáu Đen kết thúc trong bi kịch, một kẻ giết người bí ẩn lấy cảm hứng từ Lễ Tạ ơn đã khủng bố Plymouth, Massachusetts - nơi khai sinh ra ngày lễ. Loại bỏ từng cư dân một, những gì bắt đầu khi những vụ giết người trả thù ngẫu nhiên sớm được tiết lộ là một phần của kế hoạch kỳ nghỉ nham hiểm lớn hơn.','2023-12-22 08:22:55.953000','2023-12-22 08:22:55.953000','Sẽ không có thức ăn thừa.','2023-12-29 00:00:00.000000','2024-01-01 00:00:00.000000'),(31,'ngoc@gmail.com','ngoc@gmail.com','2023-12-11 16:51:59.710689','2023-11-28 22:39:25.884475','DELETED','Mission: Impossible - Dead Reckoning Part Onec','PREMIERING','2023','110','Việt Nam',6.20,'Ethan Hunt và nhóm IMF của anh bắt tay vào nhiệm vụ nguy hiểm nhất từ ​​trước đến nay: Truy tìm một loại vũ khí mới đáng sợ đe dọa toàn thể nhân loại trước khi nó rơi vào tay kẻ xấu. Với việc kiểm soát tương lai và số phận của thế giới đang bị đe dọa cũng như các thế lực đen tối từ quá khứ của Ethan đang tiến đến gần, một cuộc đua chết chóc trên toàn cầu bắt đầu. Đối mặt với kẻ thù bí ẩn và toàn năng, Ethan phải cân nhắc rằng không gì quan trọng hơn nhiệm vụ của mình—kể cả mạng sống của những người anh quan tâm nhất.','2023-12-22 08:22:55.953000','2023-12-22 08:22:55.953000','Tất cả chúng ta đều có chung số phận.','2023-12-01 00:00:00.000000','2023-1